#include <iostream>
#include <cstdio>
#include <cmath>

const char * Answer = "";

int main() {
    freopen("planaritycheck.in",  "r", stdin);
    freopen("planaritycheck.cor", "w", stdout);

    int T;

    std::cin >> T;

    for (int I = 0; I < T; I++) {
        std::string Graph;
        std::cin >> Graph;

        int N, M = Graph.size();
        N = (1 + sqrt(1 + 8 * M)) / 2;

        if (N <= 4) {
            std::cout << "YES" << std::endl;
        } else if (N == 5) {
            if (Graph == "1111111111") {
                std::cout << "NO" << std::endl;
            } else {
                std::cout << "YES" << std::endl;
            }
        } else {
            int Index = 0;
            for (int J = 0; J < M; J++) {
                Index += (Graph[M - J - 1] - '0') * (1 << J);
            }

            std::cout << (Answer[Index] == '1' ? "YES" : "NO") << std::endl;
        }
    }

    return 0;
}